  ? value.length
  : inputMaskingLength <= value.length
  ? inputMaskingLength
  : value.length;

const maskString = (str, maskChar = "*") => {
  const maskingString = maskChar.repeat(maskingLength);
  const visibleLength = str.length - maskingLength;
  if (isReverse) {
    return str.slice(0, visibleLength) + maskingString;
  } else {
    return maskingString + str.slice(-visibleLength);
  }
};

return maskString(
  context.component?.variables?.[
    /* Value */ "e96ac035-f9f0-4be4-bdff-057e708bdf86"
  ]
);

