const allOptions = context.component?.props?.[/* Options */ '4ae9760a-37c6-458a-ad1a-4ac361a6031d'] || [];

const eventValue = `${event?.['value']}`;

const allowCustomOptions = context.component?.props?.[/* Allow Custom Options */ 'e6e47cc2-d9d3-4175-ab72-e18c721d81d0'];
const customText = context.component?.props?.[/* Custom Option Text */ '8ca9f6e4-1c5a-46e1-b6a1-979d825791fd'];

const customOption = {
    label: `${customText}${eventValue}`,
    value: eventValue,
}

let hasDirectMatch = false;
const filteredOptions = allOptions.filter((option) => {
    const optionLabel = `${option.label}`.toLowerCase();
    const eventValueLower = eventValue.toLowerCase();

    if (optionLabel === eventValueLower) {
        hasDirectMatch = true;
    }
    return optionLabel.includes(eventValueLower);
})

return allowCustomOptions && !hasDirectMatch ? [customOption, ...filteredOptions] : filteredOptions;

